import React from 'react'
import styled from 'styled-components';

export default function Bottom({stats}) {
    return (
        <BottomContainer>
            <div>
                <StatsContainer>
                <Stats>
                    <p>Time Alive</p>
                </Stats>
                <Stats>{}</Stats>
                </StatsContainer>

                <Stats>
                    <p>Technology</p>
                </Stats>
                <Stats>
                    <p>Strength</p>
                </Stats>
                <Stats>
                    <p>Special Powers...</p>
                </Stats>
                <Stats>
                    <p>Loyalty...</p>
                </Stats>
            </div>
        </BottomContainer>
    )
}

const BottomContainer = styled.div`
    height: 50%;
    width: 100%;
`
const Stats = styled.div`
    flex: 1;
    background-color: rgba(0,0,0,0.5);
    clip-path: polygon(0% 0%, 100% 0%, 90% 100%, 0% 100%);
    font-size: .7em;
    // clip-path: polygon(100% 0%, 100% 100%, 10% 100%, 0% 0%);
`
const StatsContainer = styled.div`
    display: flex;
`
